import React, { useEffect, useState } from "react";
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Tooltip, Legend, Title } from "chart.js";
import { Bar, Pie } from "react-chartjs-2";

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Tooltip, Legend, Title);

export default function AnalyticsPage({ onBack }) {
  const [analytics, setAnalytics] = useState({ slots: [], summary: {} });

  useEffect(() => {
    fetch("http://localhost:4000/api/analytics")
      .then((res) => res.json())
      .then(setAnalytics);
  }, []);

  const { slots, summary } = analytics;

  // Status breakdown (for the pie chart)
  const statusData = {
    labels: ["Available", "Reserved", "Out of Order"],
    datasets: [{
      data: [
        summary.statusCounts?.available || 0,
        summary.statusCounts?.reserved || 0,
        summary.statusCounts?.out_of_order || 0,
      ],
      backgroundColor: ["#4CAF50", "#F44336", "#9E9E9E"],
      borderWidth: 1,
    }],
  };

  // Bookings/Revenue by slot (for the bar chart)
  // Sort slots by revenue for a clear bar chart
  const sortedSlots = [...slots].sort((a, b) => b.totalRevenue - a.totalRevenue);
  const barData = {
    labels: sortedSlots.map((s) => "Slot " + s.id),
    datasets: [
      {
        label: "Bookings",
        data: sortedSlots.map((s) => s.totalBookings),
        backgroundColor: "#2196F3",
      },
      {
        label: "Revenue (â‚¬)",
        data: sortedSlots.map((s) => s.totalRevenue),
        backgroundColor: "#FF9800",
      },
    ],
  };

  return (
    <div className="analytics-modal">
      <h2>Parking Analytics</h2>

      {summary && (
        <div style={{ marginBottom: "24px", textAlign: "center" }}>
          <p>
            <strong>Total Slots:</strong> {summary.totalSlots} |
            <strong>Total Bookings:</strong> {summary.totalBookings} |
            <strong>Total Revenue:</strong> â‚¬{summary.totalRevenue}
          </p>
        </div>
      )}

      <div style={{ display: "flex", flexWrap: "wrap", justifyContent: "center", gap: "24px", marginBottom: "24px" }}>
        <div style={{ width: "280px", height: "280px" }}>
          <Pie
            data={statusData}
            options={{
              plugins: {
                legend: { position: "right" },
                title: { display: true, text: "Slot Status" },
              },
            }}
          />
        </div>
        <div style={{ width: "500px", height: "320px" }}>
          <Bar
            data={barData}
            options={{
              plugins: {
                legend: { position: "top" },
                title: { display: true, text: "Bookings & Revenue per Slot" },
              },
              scales: { y: { beginAtZero: true } },
            }}
          />
        </div>
      </div>

      <table className="analytics-table">
        <thead>
          <tr>
            <th>Slot ID</th>
            <th>Status</th>
            <th>Bookings</th>
            <th>Revenue (â‚¬)</th>
          </tr>
        </thead>
        <tbody>
          {slots?.map((slot) => (
            <tr key={slot.id}>
              <td>{slot.id}</td>
              <td>{slot.status}</td>
              <td>{slot.totalBookings}</td>
              <td>â‚¬{slot.totalRevenue}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <button className="auth-btn" onClick={onBack} style={{ marginTop: "24px", width: "100%" }}>
        Close
      </button>
    </div>
  );
}
